The heart of a Druid application is your application model. Your model drives your UI. When you mutate your model, Druid compares the old and new version, and propagates the change to the components ('widgets') of your application that are affected by the change. For this to work, your model must implement the Clone and Data traits. It is important that your model be cheap to clone; we encourage the use of reference counted pointers to allow cheap cloning of more expensive types. Arc and Rc have blanket Data impls, so if you have a type that does not implement Data, you can always just wrap it in one of those smart pointers. The Data trait has a single method: /// Determine whether two values are the same. /// /// This is intended to always be a fast operation. If it returns /// `true`, the two values *must* be equal, but two equal values /// need not be considered the same here, as will often be the /// case when two copies are separately allocated. /// /// Note that "equal" above has a slightly different meaning than /// `PartialEq`, for example two floating point NaN values should /// be considered equal when they have the same bit representation. fn same(&self, other: &Self) -> bool; Derive Data can be derived. This is recursive; it requires Data to be implemented for all members. For 'C style' enums (enums where no variant has any fields) this also requires an implementation of PartialEq. Data is implemented for a number of std types, including all primitive types, String, Arc, Rc, as well as Option, Result, and various tuples whose members implement Data. Here is an example of using Data to implement a simple data model. use druid::Data;
use std::sync::Arc; #[derive(Clone, Data)]
/// The main model for a todo list application.
struct TodoList { items: Arc<Vec<TodoItem>>,
} #[derive(Clone, Data)]
/// A single todo item.
struct TodoItem { category: Category, title: String, note: Option<String>, completed: bool, // `Data` is implemented for any `Arc`. due_date: Option<Arc<DateTime>>, // You can specify a custom comparison fn // (anything with the signature (&T, &T) -> bool). #[data(same_fn = "PartialEq::eq")] added_date: DateTime, // You can specify that a field should // be skipped when computing same-ness #[data(ignore)] debug_timestamp: usize,
} #[derive(Clone, Data, PartialEq)]
/// The three types of tasks in the world.
enum Category { Work, Play, Revolution,
} Collections Data is expected to be cheap to clone and cheap to compare, which can cause issues with collection types. For this reason, Data is not implemented for std types like Vec or HashMap. This is not a huge issue, however; you can always put these types inside an Rc or an Arc, or if you're dealing with larger collections you can build Druid with the im feature, which brings in the [im crate], and adds a Data impl for the collections there. The im crate is a collection of immutable data structures that act a lot like the std collections, but can be cloned efficiently.

