If I told you that the concept of lenses comes from Haskell (the functional megolith), I'm sure you won't be surprised when I also tell you that they really excel when it comes to composition. Let's say we have an outer struct that contains an inner struct, with the inner struct containing a String. Now let's say we want to tell a label widget to display the string as text in a label. We could write a lens from the outer struct to the string, which would look something like f(&outer.inner.text), but actually we don't need to do this: we can use the then combinator. The full example is below #[derive(Lens)]
struct Outer { inner: Inner,
} #[derive(Lens)]
struct Inner { text: String
} // `composed_lens` will contain a lens that goes from `Outer` through `Inner` to `text`.
let composed_lens = Outer::inner.then(Inner::text); Side note: Because unlike Haskell, Rust has all the type information during monomorphisation, it can inline all these functions and the extra cost of having 2 lens functions disappears, leaving what you would have written by hand. When you're waiting for Rust's infamously long compilations to finish, know that you're waiting for a potentially significant run-time benefit in exchange. LensExt contains a few more useful methods for handling things like negating a boolean, or auto-Derefing a value. There are also 3 special structs in druid::lens: Constant, Identity and Unit. Constant is a lens that always returns the same value, and always discards any changes, while Identity is a lens that does nothing. You might say "what is the point of a lens that does nothing", which would be a fair question. Well, there are some places where a lens is required, and having an identity allows the user to say act as if there was no lens. It's also used to begin a composition chain using the combinators like then. Unit is a special case of Constant where the constant in question is (). Side note: Because () only has 1 value, it does actually respect mutations. It's just that mutations always result in the same value again (()).

